 windowtext; border-bottom: windowtext 0.5pt solid; background-color: transparent\"><font face=\"宋体\" size=\"2\">中等技术学校</font></td>\r\n            <td class=\"xl26\" style=\"border-right: windowtext 0.5pt solid; border-top: windowtext 0.5pt solid; border-left: windowtext; border-bottom: windowtext 0.5pt solid; background-color: transparent\"><font face=\"宋体\" size=\"2\">县级教育部门</font></td>\r\n            <td class=\"xl26\" style=\"border-right: windowtext 0.5pt solid; border-top: windowtext 0.5pt solid; border-left: windowtext; border-bottom: windowtext 0.5pt solid; background-color: transparent\"><font face=\"宋体\" size=\"2\">嘉鱼县鱼岳镇东岳路2号</font></td>\r\n            <td class=\"xl26\" style=\"border-right: windowtext 0.5pt solid; border-top: windowtext 0.5pt solid; border-left: windowtext; border-bottom: windowtext 0.5pt solid; background-color: transparent\"><font face=\"宋体\" size=\"2\">孙才汉</font></td>\r\n            <td class=\"xl26\" style=\"border-right: windowtext 0.5pt solid; border-top: windowtext 0.5pt solid; border-left: windowtext; border-bottom: windowtext 0.5pt solid; background-color: transparent\"><font face=\"宋体\" size=\"2\">437200</font></td>\r\n            <td class=\"xl26\" style=\"border-right: windowtext 0.5pt solid; border-top: windowtext 0.5pt solid; border-left: windowtext; border-bottom: windowtext 0.5pt solid; background-color: transparent\"><font face=\"宋体\" size=\"2\">07156322860</font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</p>');");
