E_D("replace into `phome_ecms_news_data_1` values('973','168','嘉鱼政务网编辑','嘉鱼政务网','<p class=\"MsoNormal\" style=\"line-height: 200%; margin: 7.8pt 0cm; mso-para-margin-top: .5gd; mso-para-margin-right: 0cm; mso-para-margin-bottom: .5gd; mso-para-margin-left: 0cm\"><span lang=\"EN-US\" style=\"line-height: 200%; font-family: 宋体; font-size: 12pt\">1. </span><span style=\"line-height: 200%; font-family: 宋体; font-size: 12pt\">报考成人高校需要什么条件？ <span lang=\"EN-US\"><br />\r\n</span>　　报考各类成人高校的考生，必须拥护四项基本原则，拥护改革开放，品德良好，遵纪守法，身体健康。在职、从业人员报考一般应根据生产和工作需要，报考对口专业。师范类高等、教育学院及普通高等学校举办的教师本、专科班主要招收在职中学教师、校长和其他教育行政干部。其中，体育、美术、音乐本、专科师资班只限招体育、美术、音乐在职教师。 <span lang=\"EN-US\"><br />\r\n</span>　 小学教师只能报考小教大专班，小教大专班也只招收小学教师。 <span lang=\"EN-US\"><br />\r\n</span>　 报考高中起点本、专科的考生应具有高中毕业文化程度或同等学历。 <span lang=\"EN-US\"><br />\r\n2. </span>怎样办理报名手续？ <span lang=\"EN-US\"><br />\r\n</span>　　符合报考条件的考生应在户口所在地的地、市、州、县招办指定的报名点办理手续。 <span lang=\"EN-US\"><br />\r\n</span>　　报名时由考生本人持正式身份证和单位介绍信履行报名手续。如在报名时节能出具有关单位或有关部门同意报考的证明，也可在录取后新生入学报到时出具。但报考师范类专业的教师必须在报名时出具。不能出具正式身体证者，必须上地、市、州和直管市招生考试机构报名和考试，报考所需照片由报名点安排拍照。报考高职班的应届毕业生可以不出具身份证，凭学生证和所在学校证明报考。 <span lang=\"EN-US\"><br />\r\n</span>　　年龄在<span lang=\"EN-US\">20</span>周岁以下的考生，报名时还必须持高中或中专的毕业证书。 <span lang=\"EN-US\"><br />\r\n</span>　　报考专升本的考生，报名时必须持国民教育系列的大学专科或专科以上的毕业证书。 <span lang=\"EN-US\"><br />\r\n</span>　　符合优录和照顾录取条件的考生，在报名同时出具有关荣誉证或相应县以上有关部门的证明一并办理优录照顾手续，过时不能补办。 <span lang=\"EN-US\"><br />\r\n<br />\r\n</span>　　报考脱产、半脱产的考生还应交县级以上的医院出具的贴有本人照片的体检合格表。报名时须交报名考务费和二寸、近期、正面、半身、免冠、同底版黑白照片三张。 <span lang=\"EN-US\"><br />\r\n3. </span>艺术类专业术科联考怎么回事？ <span lang=\"EN-US\"><br />\r\n</span>　　根据教育部有关精神，规定了省内高等艺术院校艺术专业术科加试由院校自行组织，非高等艺术院校艺术类专业术科加试，由省考试院成人招办统一组织术科基础课联考。联考课目美术类为素描、音乐类为乐理。联考时间为<st1:chsdate year=\"2011\" month=\"5\" day=\"10\" islunardate=\"False\" isrocdate=\"False\" w:st=\"on\"><span lang=\"EN-US\">5</span>月<span lang=\"EN-US\">10</span>日</st1:chsdate>下午。 <span lang=\"EN-US\"><br />\r\n</span>　　省考试院成人招办负责制定联考办法和命题工作。由院校所在地的地、市招办负责报名、考试和评卷工作。 <span lang=\"EN-US\"><br />\r\n</span>　　报省内非高等艺术院校艺术类专业考生，考完文化课后，持文化课准考证和身份证参加术科加试。 <span lang=\"EN-US\"><br />\r\n4. </span>哪些人不能报考？ <span lang=\"EN-US\"><br />\r\n</span>　 有下列情形之一者，不得报考：（一）有反对四项基本原则的言行，经教育而坚持不改者；（二）凡毕业后能取得国家承认学历的各类高、中等学校在校生、应届毕业生；（三）因在报考过程中，弄虚作假，违纪舞弊或有其它违纪行为，受到不准报考处罚未满规定期限者；（四）触犯刑律而受到处罚的服刑者。 <span lang=\"EN-US\"><br />\r\n5. </span>残疾人能否报考？ <span lang=\"EN-US\"><br />\r\n</span>　　符合报考条件，生活能自理、能坚持学习的残疾人也可报考。 <span lang=\"EN-US\"><br />\r\n6. </span>什么时间报名？ <span lang=\"EN-US\"><br />\r\n</span>　　各类成人高校招生均在<st1:chsdate year=\"2011\" month=\"3\" day=\"15\" islunardate=\"False\" isrocdate=\"False\" w:st=\"on\"><span lang=\"EN-US\">3</span>月<span lang=\"EN-US\">15</span>日</st1:chsdate>至<st1:chsdate year=\"2011\" month=\"3\" day=\"22\" islunardate=\"False\" isrocdate=\"False\" w:st=\"on\"><span lang=\"EN-US\">3</span>月<span lang=\"EN-US\">22</span>日</st1:chsdate>报名。逾期不予补报。 <span lang=\"EN-US\"><br />\r\n<br />\r\n7. </span>考生如何填报志愿和考生登记表？ <span lang=\"EN-US\"><br />\r\n</span>　　考生可根据自己的情况和单位的意见选择志愿，可报二个志愿，也可只报一个 志愿。若填报志愿不只一个时，要保持所报志愿的科类一致，考试科目相同，不能出现有的志愿栏里填的文史类，而其他志愿栏里填的却是理工类等情况（文、理兼收除外）。 <span lang=\"EN-US\"><br />\r\n</span>　　报考外语类专业的考生，可以兼报文史类专业；报考艺术类专业的考生可兼报文史类专业；报考体育类专业的考生，可以兼报理工类专业。 <span lang=\"EN-US\"><br />\r\n</span>　　考生登记表中有关项目，必须由考生本人如实填写。 <span lang=\"EN-US\"><br />\r\n</span>　 考生填报的学校和专业名称及代号，必须和《湖北招生考试》（成人招生专刊）所刊登的专业目录中所公布的一致。 <span lang=\"EN-US\"><br />\r\n8. </span>考试时间怎样安排？ <span lang=\"EN-US\"><br />\r\n</span>　　各类成人高校招生全国统一考试时间为<st1:chsdate year=\"2011\" month=\"5\" day=\"8\" islunardate=\"False\" isrocdate=\"False\" w:st=\"on\"><span lang=\"EN-US\">5</span>月<span lang=\"EN-US\">8</span>日</st1:chsdate>至<span lang=\"EN-US\">9</span>日。 <span lang=\"EN-US\"><br />\r\n9. </span>考生进考场有哪些规定？ <span lang=\"EN-US\"><br />\r\n</span>　　考生必须持准考证和身份证进入考场。每科开考十五分钟后，考生不准进入考室。 <span lang=\"EN-US\"><br />\r\n</span>　 考生除自带必要的文具用品（如钢笔、圆珠笔、铅笔、圆规、三角板、橡皮）外，书籍、资料、笔记本以及各种无线通信工具和计算器等，均不得带入考室，开考后一经查出按夹带舞弊论处。 <span lang=\"EN-US\"><br />\r\n10. </span>考生参加考试要遵守哪些纪律？ <span lang=\"EN-US\"><br />\r\n</span>　 考生必须自觉遵守考试纪律和考室规则。凡有携带规定以外的物品进入考室，经制止不改的；在考室内吸烟、交谈喧哗或有其他影响考试秩序的；在试卷规定以外的地方写姓名、准考证号或故意作其他标记的；考生在考试时，用规定以外的笔答卷的；在考试中夹带、接传答案、交换答卷，找人代替考试，抄袭（含雷同卷），带走他人答卷、撕毁试卷、涂改考号或姓名的，视其情节轻重，按违纪、舞弊考生处罚规定进行处罚。 <span lang=\"EN-US\"><br />\r\n11. </span>考试成绩如何领取？ <span lang=\"EN-US\"><br />\r\n</span>　　考生可在<st1:chsdate year=\"2011\" month=\"6\" day=\"16\" islunardate=\"False\" isrocdate=\"False\" w:st=\"on\"><span lang=\"EN-US\">6</span>月<span lang=\"EN-US\">16</span>日</st1:chsdate>至<span lang=\"EN-US\">20</span>日至报名所在地招办（或按当了招办规定），凭准考证领取成绩通知单。 <span lang=\"EN-US\"><br />\r\n</span>　　省考试院成人招办按教育部有关规定，考试成绩通知考生本人，不公布，不查卷。 <span lang=\"EN-US\"><br />\r\n12. </span>考生怎样知道录取信息？ <span lang=\"EN-US\"><br />\r\n</span>　　录取通知书由招生院校发放。考生询问录取情况直接与所报院校联系。 <span lang=\"EN-US\"><br />\r\n13. </span>为什么《准考证》必须妥善保管好？ <span lang=\"EN-US\"><br />\r\n</span>　考生录取后办理入学手续、<span lang=\"EN-US\">&ldquo;</span>预科生<span lang=\"EN-US\">&rdquo;</span>报名和<span lang=\"EN-US\">&ldquo;</span>资格生<span lang=\"EN-US\">&rdquo;</span>入学均须 交验《准考证》。考生必须将《准考证》妥善保管好。</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 200%; margin: 7.8pt 0cm; mso-para-margin-top: .5gd; mso-para-margin-right: 0cm; mso-para-margin-bottom: .5gd; mso-para-margin-left: 0cm\"><span style=\"line-height: 200%; font-family: 宋体; font-size: 12pt\"><span lang=\"EN-US\"><o:p></o:p></span></span></p>');");
